import React from 'react';
import "../Hero/Hero.css";

function Hero() {
  return (
    <>
    <div className='hero-section'>
       <div className='container category bg-light '>
        <div>Hello</div>
       </div>
    </div>
    </>
  );
}

export default Hero;
